import React from 'react'

function ShowResults({ show, max, emoji }) {
  return (
    <div>{max === 0? '' : !show? '' : 'The winner is' + emoji.map(({id, emojiCode, counter}) => {
        if(counter === max) {
            return (
                // <div key={id}>
                <span key={id}>{String.fromCodePoint(emojiCode)}</span>
                // </div>
            );
        }
    })}</div>
  )
}

export default ShowResults
